  false,\n\t\"url\": null,\n\t\"notes\": \"This map layer shows Indian lands of the
  United States. For the most part, only areas of 320 acres or more are included;
  some smaller areas deemed to be important or significant are also included. Federally-administered
  lands within a reservation are included for continuity; these may or may not be
  considered part of the reservation and are simply described with their feature type
  and the administrating Federal agency. Some established Indian lands which are larger
  than 320 acres are not included in this map layer because their boundaries were
  not available from the owning or administering agency.\",\n\t\"license_title\":
